import React, { useEffect } from 'react';
import Lottie from 'lottie-react';
import animationData from '../test.json';
import styled from 'styled-components';

const LottieWrapper = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: transparent;
  z-index: 9999;
`;

const LottieAnimation = ({ onComplete }) => {
  useEffect(() => {
    console.log('LottieAnimation mounted');

    const handleComplete = () => {
      console.log('Animation complete');
      if (onComplete) {
        onComplete(); // Appelle la fonction onComplete une fois l'animation terminée
      }
    };

    return () => {
      console.log('LottieAnimation unmounted');
    };
  }, [onComplete]);

  return (
    <LottieWrapper>
      <Lottie
        animationData={animationData}
        loop={false}
        onComplete={() => {
          console.log('Lottie animation completed');
          onComplete();
        }}
        style={{ width: '2000px', height: '100%' }}
      />
    </LottieWrapper>
  );
};

export default LottieAnimation;
